import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path fill="#999" d="M14 2v12H2V2h12m1-1H1v14h14V1z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 16 16" style="enable-background:new 0 0 16 16;" xml:space="preserve"><g>	<path fill="#999999" d="M14,2v12H2V2H14 M15,1H1v14h14V1L15,1z"/></g></svg>';
        export const SvgComponent = React.memo(SvgComp);
